import axios from 'axios';
class MessageParser {
  constructor(actionProvider) {
    this.actionProvider = actionProvider;
  }

  parse(message) {
    console.log("User Message", message);

      const data = {
        "languageCode":"en",
        "queryText":message,
        "sessionId":"121212213"
    } 
    axios.post('http://localhost:3000/dialogflow',data)
        .then(response =>{
            // console.log("Frontend:",response.data);
            // console.log("response:",response)
            if(response.data.fullfilmentText=="tomorrow")
            {
              this.actionProvider.botMessage(response.fulfillmentMessages[1]); 
            }
            this.actionProvider.botMessage(response.data);
            // console.log("After function");
        }).catch((error) => {
          console.log(error)
      });

  }
}

export default MessageParser;
